    const markersGroup = L.featureGroup().addTo(map);

    // Add markers to the map and FeatureGroup
    cities.forEach(city => {
        // Check if latitude and longitude are valid
        if (city.latitude && city.longitude) {
            const marker = L.marker([city.latitude, city.longitude])
                .bindPopup(`<b>${city.city}, ${city.state}</b>`)
                .addTo(markersGroup); // Add marker to the FeatureGroup
        } else {
            console.warn(`Invalid coordinates for ${city.city}, ${city.state}`);
        }
    });

    // Add a Leaflet Search control
    const searchControl = new L.Control.Search({
        layer: markersGroup,  // Use the FeatureGroup containing markers
        propertyName: 'city', // Search by city name
        initial: false,
        zoom: 12,
        marker: false,        // Disable auto-marker for the search
        moveToLocation: function(latlng, title, map) {
            map.setView(latlng, 12); // Center the map on the selected city
        }
    });

    // Add search functionality to the map
    searchControl.on('search:locationfound', function (e) {
        if (e.layer) {
            e.layer.openPopup(); // Open the popup for the selected city
        } else {
            console.warn('Search location found, but no layer associated.');
        }
    });

    map.addControl(searchControl); // Add search control to the map
